var get = require('./get');

    var UNDEF;

    /**
     * Check if object has nested property.
     */
    /**
     * Description
     * @method has
     * @param {} obj
     * @param {} prop
     * @return BinaryExpression
     */
    function has(obj, prop){
        return get(obj, prop) !== UNDEF;
    }

    module.exports = has;



